const n=JSON.parse('{"key":"v-771b6871","path":"/posts/c__%E5%91%BD%E5%90%8D%E7%A9%BA%E9%97%B4.html","title":"C++ 命名空间","lang":"zh-CN","frontmatter":{"icon":"edit","date":"2023-07-03T00:00:00.000Z","category":["c"]},"headers":[],"git":{"createdTime":null,"updatedTime":null,"contributors":[]},"readingTime":{"minutes":1.18,"words":353},"localizedDate":"2023年7月3日","filePathRelative":"posts/c++命名空间.md","excerpt":"<h1> C++ 命名空间</h1>\\n<p>C++中的命名空间是一种将变量、函数和类等符号封装起来的机制，用来避免同一个程序中不同部分的代码名称冲突。它可以被看作是一种组织代码的方式，可以将相关的代码放在同一个命名空间下，方便管理和使用。</p>\\n<p>一个命名空间是由关键字 <code>namespace</code> 后跟命名空间名称和花括号扩起来的一系列声明组成的。例如：</p>\\n<div class=\\"language-cpp line-numbers-mode\\" data-ext=\\"cpp\\"><pre class=\\"language-cpp\\"><code><span class=\\"token keyword\\">namespace</span> MyNamespace <span class=\\"token punctuation\\">{</span>\\n  <span class=\\"token keyword\\">int</span> myVar<span class=\\"token punctuation\\">;</span>\\n  <span class=\\"token keyword\\">void</span> <span class=\\"token function\\">myFunc</span><span class=\\"token punctuation\\">(</span><span class=\\"token punctuation\\">)</span><span class=\\"token punctuation\\">;</span>\\n  <span class=\\"token keyword\\">class</span> <span class=\\"token class-name\\">MyClass</span> <span class=\\"token punctuation\\">{</span><span class=\\"token punctuation\\">}</span><span class=\\"token punctuation\\">;</span>\\n<span class=\\"token punctuation\\">}</span>\\n</code></pre><div class=\\"line-numbers\\" aria-hidden=\\"true\\"><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div><div class=\\"line-number\\"></div></div></div>"}');export{n as data};
